import React,{useState} from 'react'

const Compo1 = () => {
    const[count,setcount]=useState(0);
    const incre = ()=>{
        setcount(count+1);
    }
  return (
    <div><div>
    <button onClick={incre}>incre</button>

    <h1>{count}</h1>

    </div></div>
  )
}

export default Compo1
